  const COLUMNS = [
    {
      Header: "Name",
      accessor: "fullname",
    },
    {
      Header: "Position",
      accessor: "position",
    },
    {
      Header: "e-Mail",
      accessor: "email",
    },
    {
      Header: "Last login",
      accessor: "lastlogin",
    },
    {
      Header: "Status",
      accessor: "status",
    },
  ];

  const columns = useMemo(() => COLUMNS, []);
  const data = useMemo(() => users, []);
};

export default UsersDetails;
